import { Grid,Box } from "@mui/material";

const Layout = (props: any) => {
    return (
        <>
            <Grid  container spacing={2}>
                <Grid item xs={4}>
                    <Box style={{backgroundColor: '#c2c2c2'}}>
                        <h1>Header Part</h1>
                    </Box>
                    <Box display="flex">
                        {props.children}
                    </Box>
                </Grid>
            </Grid>

            <Grid>
            <Grid item xs={4}>
                    <h1>Footer Part</h1>
                </Grid>
            </Grid>
        </>
    )
}

export default Layout;
